import React from 'react';
import { ReactComponent as SunSVG } from '../images/sun.svg';
import { ReactComponent as CloudSVG } from '../images/cloud.svg';

import './Background.css';

function Background() {
  return (
    <>
      <SunSVG
        className="sun-svg"
        style={{ top: '40px', right: '8%', height: '100px' }}
      />
      <CloudSVG
        className="cloud-svg"
        style={{ top: '110px', left: '150px', height: '100px', zIndex: -3 }}
      />
      <CloudSVG
        className="cloud-svg"
        style={{ top: '120px', left: '150px', height: '100px', zIndex: -3 }}
      />
      <CloudSVG
        className="cloud-svg"
        style={{ top: '80px', right: '12%', height: '100px' }}
      />
      <CloudSVG
        className="cloud-svg"
        style={{ top: '220px', right: '20%', height: '65px' }}
      />
    </>
  );
}

export default Background;
